import React from 'react';
import { NavLink, useLocation } from 'react-router-dom';

const superAdminLinks = [
  { path: '/super-admin', label: 'Dashboard', icon: <span role="img" aria-label="dashboard">üè†</span> },
  { path: '/super-admin/manage-roles', label: 'Manage Roles', icon: <span role="img" aria-label="roles">üßë‚Äçü§ù‚Äçüßë</span> },
  { path: '/super-admin/book-room', label: 'Book Room', icon: <span role="img" aria-label="book room">üóìÔ∏è</span> },
  { path: '/super-admin/my-bookings', label: 'My Bookings', icon: <span role="img" aria-label="my bookings">üìã</span> },
  { path: '/super-admin/all-bookings', label: 'All Bookings', icon: <span role="img" aria-label="bookings">üìë</span> },
  { path: '/super-admin/all-announcements', label: 'All Announcements', icon: <span role="img" aria-label="announcements">üì£</span> },
  { path: '/super-admin/all-issues', label: 'All Issues', icon: <span role="img" aria-label="issues">üõ†Ô∏è</span> },
  { path: '/super-admin/manage-rooms', label: 'Manage Rooms', icon: <span role="img" aria-label="rooms">üè¢</span> },
  { path: '/super-admin/calendar', label: 'Calendar', icon: <span role="img" aria-label="calendar">üìÖ</span> },
  { path: '/super-admin/create-poll', label: 'Create Poll', icon: <span role="img" aria-label="poll">üó≥Ô∏è</span> },
];

const Sidebar = () => {
  const location = useLocation();

  return (
    <aside
      style={{
        width: '230px',
        backgroundColor: '#1a237e',
        color: '#fff',
        position: 'fixed',
        left: 0,
        top: 0,
        height: '100vh',
        display: 'flex',
        flexDirection: 'column',
        boxSizing: 'border-box',
        zIndex: 1000
      }}
    >
      <div style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: '20px',
        borderBottom: '1px solid #3f4771'
      }}>
        <div style={{
          fontSize: '1.8rem',
          fontWeight: '800',
          color: '#00bfff',
          marginBottom: '4px'
        }}>
          üöÄ INCOR
        </div>
        <span style={{
          fontSize: '1.45rem',
          color: '#00bfff',
          fontWeight: 900,
          letterSpacing: '1.5px',
          marginTop: '2px'
        }}>
          Super Admin
        </span>
      </div>
      {/* Scrollable menu */}
      <div
        style={{
          flex: 1,
          overflowY: 'auto',
          scrollbarWidth: 'none', // Firefox
          msOverflowStyle: 'none', // IE 10+,
        }}
      >
        <style>
          {`
            /* Hide scrollbar for Chrome, Safari and Opera */
            div[style*="overflow-y: auto"]::-webkit-scrollbar {
              display: none;
            }
          `}
        </style>
        <ul style={{ listStyle: 'none', padding: '24px 0 0 0', margin: 0 }}>
          {superAdminLinks.map(({ path, label, icon }) => {
            // FIXED: Custom active logic for dashboard
            const isActive = location.pathname === path || 
              (path === '/super-admin' && location.pathname === '/super-admin/');
            
            return (
              <li key={path} style={{ marginBottom: '8px' }}>
                <NavLink
                  to={path}
                  style={({ isActive: navIsActive }) => ({
                    display: 'flex',
                    alignItems: 'center',
                    padding: '14px 20px',
                    color: isActive || navIsActive ? '#00bfff' : '#b0bec5',
                    textDecoration: 'none',
                    fontSize: '1.05rem',
                    fontWeight: isActive || navIsActive ? '600' : '400',
                    backgroundColor: isActive || navIsActive ? 'rgba(0, 191, 255, 0.1)' : 'transparent',
                    borderLeft: isActive || navIsActive ? '4px solid #00bfff' : '4px solid transparent',
                    transition: 'all 0.3s ease'
                  })}
                >
                  <span style={{ marginRight: '12px', fontSize: '1.1rem' }}>
                    {icon}
                  </span>
                  {label}
                </NavLink>
              </li>
            );
          })}
        </ul>
      </div>
    </aside>
  );
};

export default Sidebar;
